-- Criar categoria principal para Símbolos Variados
INSERT INTO public.engraving_categories (id, name, description, sort_order, active) VALUES 
(gen_random_uuid(), 'Símbolos Variados', 'Coleção diversificada de símbolos para personalização', 4, true);

-- Inserir todos os 131 símbolos variados
